import React from 'react';

import Banner from './elements/banner';



function Elements() {
  return (
    <react-fragment> 
        <Banner/>
        <TextArea/>
        <ButtonArea/>
        <WholeWrap />
    </react-fragment>
  );
}

export default Elements;
